import * as React from "react";
import {
  Text,
  View,
  Image,
  StyleSheet,
  SafeAreaView,
  FlatList,
  ImageBackground,
  TouchableOpacity,
  ScrollView,
} from "react-native";

import Feather from "react-native-vector-icons/Feather";
import Ionicons from "react-native-vector-icons/Ionicons";
import { Icon } from "react-native-elements";

import MaterialCommunityIcons from "react-native-vector-icons/MaterialCommunityIcons";
import categoriesData from "../../assets/data/categoriesData";
import popularData from "../../assets/data/popularData";
import colors from "../../assets/colors/colors";
const image = require("../../assets/image/bgpurple.png");

function NhatKy({ navigation }) {
  return (
    <ImageBackground source={image} style={styles.imageBgContainer}>
      <SafeAreaView>
        {/* <Ionicons
          name="arrow-back-outline"
          size={32}
          color={colors.white}
          style={{ paddingTop: 20 }}
        /> */}

        <View style={styles.titleWrapper}>
          <Text style={styles.titleTitle}>Nhật ký</Text>
          <Feather
            name="calendar"
            size={32}
            color={colors.white}
            paddingRight={5}
          />
        </View>

        <Text style={styles.date}>Hôm nay, XX tháng X</Text>

        <View style={styles.boxWrapper}>
          <View style={styles.boxtItem}>
            <View style={styles.boxWrapperLeft}>
              <View style={styles.boxWrapperTop}>
                <View style={{ flexDirection: "row" }}>
                  <Text style={styles.text_s16_w600}>Thức ăn </Text>
                  <Text style={styles.text_s13_w600}>(Kcal)</Text>
                </View>

                <Text style={styles.text_s32_w600}>XXX</Text>
                <Text style={styles.text_s13_w400}>Cả ngày</Text>
              </View>
              <View style={styles.boxWrapperBottom}>
                <Text style={styles.text_s13_600}>Mục tiêu </Text>
                <Text style={styles.text_s16_w600}>XXX</Text>
              </View>
            </View>
            <View style={styles.boxWrapperRight}>
              <Feather name="chevron-right" size={32} color={colors.black} />
            </View>
          </View>

          <View style={styles.boxtItem}>
            <View style={styles.boxWrapperLeft}>
              <View style={styles.boxWrapperTop}>
                <View style={{ flexDirection: "row" }}>
                  <Text style={styles.text_s16_w600}>Cân nặng </Text>
                  <Text style={styles.text_s13_w600}>(Kg)</Text>
                </View>

                <Text style={styles.text_s32_w600}>X.XX</Text>
                <Text style={styles.text_s13_w400}>XX tháng XX</Text>
              </View>
              <View style={styles.boxWrapperBottom}>
                <Text style={styles.text_s13_600}>Mục tiêu </Text>
                <Text style={styles.text_s16_w600}>X.XX</Text>
              </View>
            </View>
            <View style={styles.boxWrapperRight}>
              <Feather name="chevron-right" size={32} color={colors.black} />
            </View>
          </View>
        </View>
        <View style={styles.boxWrapper}>
          <View style={styles.boxtItem}>
            <View style={styles.boxWrapperLeft}>
              <View style={styles.boxWrapperTop}>
                <Text style={styles.text_s16_w600}>Tập luyện </Text>
              </View>
              <View style={styles.boxWrapperBottom}>
                <Text style={styles.text_s13_w400}>
                  Hôm nay bạn và bé đã tập được những gì? Mau ghi lại nào!
                </Text>
              </View>
              <View style={styles.boxWrapperRight}>
                <Feather name="chevron-right" size={32} color={colors.black} />
              </View>
            </View>
          </View>
        </View>
        {/* popular */}
      </SafeAreaView>
    </ImageBackground>
  );
}

const styles = StyleSheet.create({
  imageBgContainer: {
    flex: 1,
    padding: 30,
  },

  titleWrapper: {
    flexDirection: "row",
    justifyContent: "space-between",
    alignItems: "center",
    marginTop: 30,
  },

  titleTitle: {
    fontSize: 32,
    color: colors.white,
  },
  date: {
    paddingTop: 10,
    fontSize: 16,
    fontWeight: "400",
    color: colors.white,
    marginBottom: 8,
  },

  boxtWhite: {},
  text_s13_w600: {
    fontSize: 13,
    fontWeight: "600",
  },
  text_s13_w400: {
    fontSize: 13,
    fontWeight: "400",
  },
  text_s32_w600: {
    fontSize: 32,
    fontWeight: "600",
  },
  text_s16_w600: { fontSize: 16, fontWeight: "bold" },
  text_s13_w600: { fontSize: 13, fontWeight: "bold" },

  boxWrapper: {
    flex: 1,
    flexDirection: "row",
    justifyContent: "space-between",
  },
  boxtItem: {
    flexDirection: "row",
    justifyContent: "space-between",
    width: 140,
    height: 140,
    borderRadius: 16,
    borderColor: "#A9A9A9",
    borderWidth: 1,
    backgroundColor: colors.white,
  },
  boxWrapperLeft: {
    flex: 1,
    paddingLeft: 15,
    paddingTop: 10,
    flexDirection: "column",
    justifyContent: "space-between",
  },

  boxWrapperTop: {},

  boxWrapperBottom: {
    flexDirection: "row",
    justifyContent: "space-between",
    paddingBottom: 10,
  },
  boxWrapperRight: {
    alignSelf: "center",
  },
});

export default NhatKy;
